import React from "react";
import { Spring, animated } from "react-spring/renderprops";
import paths from "./paths";
import { interpolate } from "flubber";
const Animation = () => {
  console.log(paths["discord"], paths["youtube"]);

  const interpolator = interpolate(paths["discord"], paths["youtube"]);
  console.log("INTERPOLATOR", interpolator(0.5));
  return (
    <svg width="500" height="500" viewBox="0 0 500 500">
      <Spring reset reverse native from={{ t: 0 }} to={{ t: 1 }}>
        {({ t }) => <animated.path d={t.interpolate(interpolator)} />}
      </Spring>
    </svg>
  );
};

export default Animation;
